	TweenMax.to("#posCloudeMove > *:nth-child(1) > *:nth-child(1) ",10,{x:-10,repeat:-1,yoyo:true,ease:Power0.easeNone})
	TweenMax.to("#posCloudeMove > *:nth-child(1) > *:nth-child(2) ",10,{x:10,repeat:-1,yoyo:true,ease:Power0.easeNone})
	TweenMax.to("#posCloudeMove > *:nth-child(1) > *:nth-child(3) ",10,{x:-10,repeat:-1,yoyo:true,ease:Power0.easeNone})
	// 
	for(let i = 1; i <= 16; i++ ){
		if(i % 2 == 0)TweenMax.to("#posCloudeMove > *:nth-child(2) > *:nth-child(" + i + ") ",5,{x:-2,y:-5,repeat:-1,delay:-i/5,yoyo:true,ease:Power0.easeNone})
		else TweenMax.to("#posCloudeMove > *:nth-child(2) > *:nth-child(" + i + ") ",5,{x:2,y:-5,repeat:-1,delay:-i/5,repeatDelay:0.5,yoyo:true,ease:Power0.easeNone})
	}
	// 
	for(let i = 1; i <= 18; i++ ){
	 TweenMax.to("#posStarWhite > *:nth-child(" + i + ") ",1,{opacity:0.1,repeat:-1,delay:-i/10,yoyo:true,ease:Power0.easeNone})
	}
	// 
	for(let i = 1; i <= 8; i++ ){
	 TweenMax.to("#posStarYellow > *:nth-child(" + i + ") > *:nth-child(1)",1,{opacity:0.1,repeat:-1,delay:-i/2,yoyo:true,ease:Power0.easeNone})
	}
	//
	// 
	for(let i = 1; i <= 13; i++ ){
	TweenMax.to("#posBuildLightYellow > *:nth-child(" + i + "),#posBuildLightYellow > *:nth-last-child(" + i + ")",1,{opacity:0.1,repeat:-1,delay:-i/2,yoyo:true,ease:Power0.easeNone})
	}
	//
	TweenMax.fromTo("#posCarMove1",10,{x:-250,y:80,scale:1.2,opacitytransformOrigin:"50% 50%"},{x:200,y:-50,scale:0.7,repeat:-1,repeatDelay:0.5});
	TweenMax.fromTo("#posCarMove2",5,{x:50,y:-20,scale:1.2,opacitytransformOrigin:"50% 50%"},{x:-50,y:50,scale:0.7,repeat:-1,repeatDelay:0.5});
	TweenMax.fromTo("#posCarMove3",8,{x:200,y:150,scale:0.7,opacitytransformOrigin:"50% 50%"},{x:-200,y:-200,scale:1.2,repeat:-1,repeatDelay:0.5,delay:2});
	TweenMax.fromTo("#posCarMove4",5,{x:50,y:-20,scale:1.2,opacitytransformOrigin:"50% 50%"},{x:-50,y:50,scale:0.7,repeat:-1,repeatDelay:0.5,delay:-2.5});

	/////////////////////main tl/////////////////////////////////
	let tlposText = new TimelineMax({})
		.from("#posText2",0.5,{opacity:0},"tlposText")
		;
	for(let i = 1; i <= 9; i++){
		tlposText.from("#posTextTyping > *:nth-child(" + i + ")",0.1,{opacity:0,scale:0.8,transformOrigin:"50% 50%",ease: Elastic.easeOut.config(2, 1)},"-=0.05");
	}

	tlposText
		.from("#posText1",0.5,{opacity:0,y:-10},"tlposText+=0.5")
		.from("#posText3",0.5,{opacity:0,y:10},"tlposText+=0.5")
		.from("#posText4",0.5,{opacity:0,y:-10,scale:0.8,transformOrigin:"50% 50%"},"tlposText+=0.5")
		.from("#posText5",0.5,{opacity:0,y:10,},"tlposText+=0.5")
		.from("#posText6",1,{opacity:0,scale:0,transformOrigin:"50% 50%",ease: Elastic.easeOut.config(1, 0.5)},"tlposText+=0.8")
		.from("#posDumBym",5,{scale:0,transformOrigin:"50% 50%",ease: Elastic.easeOut.config(1, 0.5)},"tlposText")
		.call(()=>{
			TweenMax.to("#posDumBym",5,{scale:1.05,repeat:-1,yoyo:true,ease: Elastic.easeInOut.config(1, 0.5)})
		})
		.from("#posSfera",5,{scale:0,transformOrigin:"50% 50%",ease: Elastic.easeOut.config(1, 0.5)},"tlposText+=0.25")
		.call(()=>{
			let tlposTextafter = new TimelineMax({repeatDelay:1,repeat:-1})
			for(let i = 1; i <= 6; i++){
				tlposTextafter.to("#posText" + i,2,{scale:1.05,repeat:1,yoyo:true,delay:0.5,transformOrigin:"50% 50%",ease: Elastic.easeOut.config(1, 0.5)},"-=2")
			}

		})
;


</script>
